import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

export default function FormPropsTextFields() {
  return (
    <Box>
      <div>
        <TextField
          sx={{
            input:{
                fontWeight:'700',
                border:'none',
                borderRadius:'4px',
                
            },
            width:{lg:'800px',xs:"350px"},
            backgroundColor:'#fff',
            borderRadius:"40px",
            mx: 'auto',
            m:10,
          textAlign: 'center',
          fontSize: '0.875rem',
          fontWeight: '700'
        }}
          required
          id="outlined-required"
          label="Required"
          type="text"
          placeholder='Full Name'
        /><br/>
        <TextField
        sx={{
          input:{
              fontWeight:'700',
              border:'none',
              borderRadius:'4px'
          },
          width:{lg:'800px',xs:"350px"},
          backgroundColor:'#fff',
          borderRadius:"40px"
      }}
          id="outlined-password-input"
          label="Password"
          type="password"
          autoComplete="current-password"
        /><br/>
        <TextField
        sx={{
          input:{
              fontWeight:'700',
              border:'none',
              borderRadius:'4px'
          },
          width:{lg:'800px',xs:"350px"},
          backgroundColor:'#fff',
          borderRadius:"40px"
      }}
          id="outlined-required"
          label="Required"
          type="email"
          placeholder='Email'
        />
      </div>
    </Box>
  );
}
